import React from 'react';
import ReactDOM from 'react-dom';
import Header from './Components/Header';
import Home from './Pages/Home';
import Footer from './Components/Footer';
import ApiRepository from './Library/ApiRepositories'

class Index extends React.Component {

	constructor(props){
		super(props);
		this.property = this.getRequiredData();
		this.state = {
			header: this.property.header,
			footer: null,
			body: null
		}    		
	}
	async getRequiredData() {
        this.header = await ApiRepository.GetMenu();
        this.footer = await ApiRepository.GetMenu();
		this.body = await ApiRepository.GetMenu();

		return {header: this.header, body: this.body, footer: this.footer}                              
	 }

	render(props){
		const property = this.getRequiredData();
        return(
			<div>
				<Header header = {property.header} />
				<Home/>
				<Footer/>
			</div>
		);
	}
}

